INSERT INTO `info_lang` (`id_info`, `id_shop`, `id_lang`, `text`) VALUES
(1, 1, 1, '<h1>O nas</h1>\n<hr style=\"height:2px;background-color:#ff0000;\" />\n<div class=\"about\">\n<div class=\"left\">\n<p style=\"text-align:left;\"><strong>Toys4Boys – najlepszy sklep internetowy z prezentami i gadżetami!</strong></p>\n<p>Toys4Boys stworzyliśmy z myślą o osobach, które cenią sobie oryginalność i nowoczesność. Dokładnie takie same gadżety, które znajdziesz w naszym sklepie.</p>\n<p>Niezmiennie – od 2015 roku – chcemy zaskakiwać naszych Klientów. Stale poszukujemy nowości i innowacji produktowych. Na bieżąco poszerzamy długo listę niesamowitych gadżetów, których na próżno szukać w innych sklepach w Polsce.</p>\n<p>Niektóre z produktów tworzymy sami. Mamy wtedy stuprocentową pewność co do ich funkcjonalności i jakości wykonania. Wierzymy, że spełnią one wymagania nawet tych najbardziej wymagających użytkowników.</p>\n<p>Jeśli szukasz więc prezentu, który okaże się prawdziwą niespodzianką lub po prostu chcesz wnieść do swojego życia odrobinę kreatywności, a przy tym nie chcesz wydać fortuny – jesteś pod dobrym adresem!</p>\n</div>\n<div class=\"right\"><img src=\"https://www.toys4boys.pl/upload/steasycontent/obrazek-sekcjaonas.png\" alt=\"Toys4Boys\" /></div>\n</div>\n<p><b>TOYS4BOYS – SKLEP Z UPOMINKAMI. POMYSŁY NA PREZENT NA KAŻDĄ OKAZJĘ</b></p>\n<div class=\"column\">\n<p style=\"text-align:justify;\"><strong>SKLEP Z GADŻETAMI</strong></p>\n<p style=\"text-align:justify;\">W Toys4Boys uważamy, że każdy zasługuje na<strong>oryginalny prezent</strong>. Dlatego właśnie wszystkie<strong>pomysły na prezent na urodziny</strong>, które znajdziesz w naszym<strong>sklepie z upominkami</strong>są nietypowe i zaskakujące. Wciąż powiększamy asortyment o nowe<strong>gadżety</strong>i<strong>śmieszne prezenty</strong>, ale także produkty, które są funkcjonalne i ładne. Dbamy o to, aby asortyment, czyli<strong>prezenty</strong>i<strong>gadżety</strong>były ciągle świeże, na topie i wzbudzały zainteresowanie. Odwiedzaj nasz nietypowy,<strong>śmieszny sklep c</strong>o jakiś czas, aby sprawdzić czy nie mamy czegoś nowego i czy, aby na pewno nie ominęły Cię interesujące<strong>prezenty dla chłopaka</strong>. Pamiętaj –<strong>fajny prezent</strong>to<strong>trafiony prezent</strong>! Podzieliliśmy nasze oryginalne prezenty na kategorie, by łatwiej było Wam wybrać<strong>idealny prezent dla chłopaka</strong>czy dziewczyny.</p>\n<p style=\"text-align:justify;\"><strong>PREZENT DLA NIEGO</strong></p>\n<p>Aby wybrać<strong>idealny prezent dla Niego</strong>trzeba się nieźle napocić! Wie to każda kobieta, która nie przespała kilku nocy zastanawiając się, czym powinien być <strong>prezent dla mężczyzny</strong>. Niestety nie ma jednej recepty na<strong>trafiony prezent dla chłopaka</strong>. Naszym zdaniem przy wyborze upominku należy kierować się zainteresowaniami i hobby faceta. Jeśli dodasz do tego trochę funkcjonalności i zabawy –<strong>pomysł na prezent dla niego</strong>sam się znajdzie!</p>\n<p style=\"text-align:justify;\"><strong>PREZENT DLA CHŁOPAKA</strong></p>\n<p>W Toys4Boys znajdziesz<strong>pomysły na prezent dla chłopaka</strong>, które go zachwycą.<strong>Prezent dla chłopaka na urodziny</strong>nie będzie stanowił żadnego problemu, gdy zajrzysz do naszej kategorii. W Toys4Boys mamy setki gadżetów, które świetnie nadadzą się na tę okazję. Jeśli razem uwielbiacie podróżować to<strong>oryginalnym prezentem</strong>będzie Korkowy Globus, na którym będziecie mogli zaznaczać odbyte podróże. A może Twój chłopak jest fanemStar Wars? Jeśli tak to mamy<strong>oryginalny prezent dla niego</strong>–Toster Star Wars Darth Vaderw kształcie hełmu Vadera, który wypieka tosty z logiem Gwiezdnych Wojen.</p>\n<p style=\"text-align:justify;\"><strong>PREZENT DLA MĘŻA</strong></p>\n<p style=\"text-align:justify;\">Nie masz pomysłu,<strong>jaki prezent dla męża kupić</strong>? Pilnie potrzebny Ci<strong>prezent dla męża na urodziny</strong>? Żaden problem! W Toys4Boys mamy wiele pomysłów na upominki, które zachwycą Twojego mężczyznę. Jeśli jest koneserem whisky, na pewno ucieszy się z Plakatu Zdrapki 100 whisky do wypicia przed śmiercią, gdzie okienka z nazwami trunków, które miał już przyjemność skosztować. Podróżny organizer łazienkowy to ciekawy<strong>pomysł na prezent dla męża</strong>, który dużo podróżuje służbowo. Gadżet pomoże mu uporać się z wieczornym goleniem i kąpielą w każdym miejscu. Znajdziesz w naszym sklepie także<strong>prezent dla męża z okazji rocznicy ślubu</strong>.</p>\n<p style=\"text-align:justify;\"><strong>PREZENT DLA NIEJ</strong></p>\n<p style=\"text-align:justify;\">Toys4Boys to nie tylko męskie gadżety. W naszej ofercie znajdziesz też<strong>prezent dla niej</strong>, który zapamięta na długo.<strong>Prezent na urodziny dla niej</strong>musi być wyjątkowy, więc nie kupuj go w pośpiechu na ostatnią chwilę. Już miesiąc wcześniej, pomyśl, jaki<strong>trafiony prezent</strong>mógłbyś jej podarować. W naszym sklepie online z prezentami znajdziesz zarówno romantyczne upominki, jak i zabawne gadżety, które przydadzą się jej w życiu.</p>\n<p style=\"text-align:justify;\"><strong>PREZENT DLA DZIEWCZYNY</strong></p>\n<p style=\"text-align:justify;\">Oryginalny<strong>prezent na urodziny dla dziewczyny</strong>to niezłe wyzwanie dla faceta. W końcu urodziny ma tylko raz w roku! Głupio byłoby popsuć jej humor kompletnie nietrafionym prezentem. Spokojnie, u nas na pewno znajdziesz<strong>pomysł na prezent dla dziewczyny</strong>. Musisz tylko wejść w odpowiednią zakładkę, a tam czeka cała kopalnia inspiracji prezentowych: od bajeranckich gadżetów, po relaksujące Zestawy SPA dla niej.</p>\n<p style=\"text-align:justify;\"><strong>PREZENT DLA ŻONY</strong></p>\n<p style=\"text-align:justify;\">Żona to najważniejsza kobieta w Twoim życiu, no może zaraz po mamusi. Jeśli potrzebjesz<strong>idealnego prezentu dla żony</strong>, która wszystko ma, koniecznie przejrzyj ofertę Toys4Boys. Sądzimy, że spodoba jej się któryś z naszych stojaków na biżuterię albo akcesoriów do wina. A szczęśliwa żona to zadowolony mąż!</p>\n<p style=\"text-align:justify;\"><strong>PREZENT DLA DZIECKA</strong></p>\n<p style=\"text-align:justify;\">Dzieci jak to dzieci kochają dostawać upominki. Jeśli chcesz kupić<strong>prezent dla dziecka na roczek</strong>, możemy polecić nasz bestseller BabyMop. Dla malucha sprawdzi się także Małpka do przytulania Fingerlings. Cały czas też poszerzamy nasz asortyment, więc niewykluczone, że w momencie, gdy to czytasz mamy już mnóstwo nowych pomysłów na prezent dla dziecka. Bądź więc z nami na bieżąco!</p>\n<p style=\"text-align:justify;\"><strong>PREZENT NA URODZINY</strong></p>\n<p style=\"text-align:justify;\">Urodziny to jeden z ważniejszych dni w roku, więc<strong>prezent na urodziny</strong>musi być wyjątkowy. Przy wyborze<strong>idealnego prezentu urodzinowego</strong>głównym kryterium powinny być zainteresowania solenizanta i jego osobowość. Nie wszyscy lubią<strong>śmieszne prezenty</strong>, niektórzy wolą coś bardziej funkcjonalnego, co nie będzie zbierało kurzu na komodzie. W Toys4Boys wiemy o tym i dlatego przygotowaliśmy wiele pomysłów na prezent urodzinowy.</p>\n<p style=\"text-align:justify;\"><strong>PREZENT NA 18</strong></p>\n<p style=\"text-align:justify;\">18 lat ma się tylko raz w życiu! Prezent na osiemnastkę<span></span>też powinien być wystrzałowy i nietypowy. Jako<strong>prezent na 18 dla dziewczyny</strong>podaruj ogromny Kieliszek XXL z brokatową liczbą 18 lub Plakat Zdrapkę 100 miejsc do zobaczenia przed śmiercią, który zmotywuje ją do wielu podróży. Na<strong>prezent na 18 dla chłopaka</strong>nada się Kufel do piwa, który przypomniał mu będzie, że od teraz może pić alkohol legalnie, bez chowania się po krzakach :)</p>\n<p style=\"text-align:justify;\"><strong>GADŻETY DLA GRACZA</strong></p>\n<p style=\"text-align:justify;\">Granie w gry to, coś co sprawia Ci największą przyjemność i zarwałeś niejedną nockę próbując przejść kolejny poziom? W takim razie witamy Cię w Toys4Boys! Trafiłeś w fantastyczne miejsce, gdzie wyposażymy Cię w genialne<strong>gadżety dla gracza</strong>! Kubek dla gracza, Miska Game Over, Wycieraczka w kształcie pada do gry? To wszystko znajdziesz u nas! Jeśli szukasz<strong>prezentu dla gracza</strong>- nie mogłeś trafić lepiej! Wiemy, co kręci graczy i w swojej ofercie mamy super retro konsole do grania, gadżety Minecraft i Nintendo - sto razy lepsze niż seriale na Netflix!</p>\n</div>');
