(56, 1, 1, 'Bogactwo Zapachów:Zestaw oferuje trzy wyjątkowe kompozycje zapachowe: uwodzicielską piwonię, zmysłową magnolię z różowym pieprzem oraz energetyzujące kiwi i winogrona, idealne na różne okazje i nastroje.Idealny na Prezent:Elegancko zapakowany w kartonik sześciopak, zestaw jest gotowy do wręczenia jako upominek na urodziny, Dzień Kobiet czy inne specjalne okazje, gwarantując radość i satysfakcję obdarowanej.Praktyczna Pojemność:Miniaturowe buteleczki o pojemności 100 ml są doskonałe do podróży, na siłownię czy basen, zapewniając luksusową pielęgnację skóry w dowolnym miejscu.Wegańska i Naturalna Formuła:Żele zawierają łagodne substancje myjące oraz kompleksy składników nawilżających, zapewniając delikatne, a zarazem skuteczne oczyszczanie i ochronę skóry.Wszechstronne Zastosowanie:Doskonałe do codziennego użytku, te wegańskie żele sprawdzają się w każdej sytuacji, dostarczając skóry odżywcze składniki i zmysłowe zapachy.', '', 'czysciopak-damski-3-x-zel-500ml-rock-class-bossy', '', '', '', 'Czyściopak Damski - 3 x Żel 500ml - Rock, Class, Bossy', '', '', '', ''),
(57, 1, 1, 'Naturalna Formuła:Peeling cukrowy jest wegański i zawiera składniki pochodzenia roślinnego, takie jak masło shea i gliceryna, zapewniając delikatne, ale skuteczne oczyszczanie skóry.Uwodzicielski Zapach:Aromaty magnolii i różowego pieprzu tworzą zmysłową kompozycję zapachową, wzbogaconą o nuty pomarańczy, róży i wanilii, które pozostawiają skórę subtelnie pachnącą.Efekt Ujędrniający i Antycellulitowy:Dzięki zawartości ekstraktów z zielonej kawy, papryki i cynamonu, peeling wspomaga ujędrnianie skóry oraz redukcję cellulitu.Wygładzające Działanie:Złuszcza martwy naskórek, pozostawiając skórę gładką i miękką, doskonale przygotowaną do dalszych zabiegów pielęgnacyjnych.Łatwa Aplikacja:Lekką konsystencję musu łatwo rozprowadza się na skórze, a po spienieniu i spłukaniu pozostawia odświeżający efekt, działając jak alternatywa dla żelu pod prysznic.', '', 'magnolia-peeling-cukrowy-220g-zapach-melon', '', '', '', 'Magnolia - Peeling cukrowy 220g, zapach Melon', '', '', '', ''),
(58, 1, 1, 'Niezapomniane Doświadczenie:Każde fondue zamienia się w wyjątkowy moment dzięki zabawnemu, otwierającemu oczy kotkowi, co sprawia, że spotkania są bardziej interaktywne i angażujące.Wszechstronność:Nadaje się zarówno do serowego, jak i czekoladowego fondue, co czyni go uniwersalnym dodatkiem do każdej kuchni.Estetyka i Funkcjonalność:Oryginalny design łączy piękno z praktycznością, przyciągając wzrok i dodając osobistego akcentu do każdego posiłku.Świetny na Prezent:Dzięki wyjątkowemu wyglądowi i funkcji termoczułej, zestaw jest wspaniałym prezentem, który zaskoczy i ucieszy każdego miłośnika kotów i kulinarnych przygód.Praktyczne Akcesoria:W zestawie znajduje się świeczka i cztery widelce z różnymi kolorami, co ułatwia różnicowanie i używanie zestawu podczas wspólnych posiłków.', '', 'magiczne-fondue-czarny-kot', '', '', '', 'Magiczne Fondue - Czarny Kot', '', '', '', ''),
(59, 1, 1, 'Wszechstronność Wykorzystania:Od Jalapeno czerwonego i zielonego, idealnych do sals, nachos i marynat, po intensywne chili Ancho – zestaw oferuje składniki do wielu dań, od zup po dania z grilla.Intensywna Pikantność:Papryka Bird\'s Eye oraz chili grys i krążki dodają potrawom niezwykłej ostrości, idealnej do dań takich jak curry, stir-fry czy pikantne sosy.Estetyczne Opakowanie:Schowany w poręcznym kartoniku z urzekającą grafiką zestaw stanowi doskonały prezent dla miłośników kulinariów, gotowy do wręczenia na każdą okazję.Inspiracja do Eksperymentów:Zestaw zachęca do eksploracji i eksperymentowania ze smakami, umożliwiając tworzenie wyjątkowych dań i odkrywanie nowych wymiarów kulinarnych doznań przez cały rok.', '', 'zestaw-dibys-przyprawy-chili', '', '', '', 'Zestaw DIBYS - Przyprawy Chili', '', '', '', ''),
