(1333, 1, 1, 'Bogactwo Zapachów:Zestaw oferuje trzy wyjątkowe kompozycje zapachowe: uwodzicielską piwonię, zmysłową magnolię z różowym pieprzem oraz energetyzujące kiwi i winogrona, idealne na różne okazje i nastroje.Idealny na Prezent:Elegancko zapakowany w kartonik sześciopak, zestaw jest gotowy do wręczenia jako upominek na urodziny, Dzień Kobiet czy inne specjalne okazje, gwarantując radość i satysfakcję obdarowanej.Praktyczna Pojemność:Miniaturowe buteleczki o pojemności 100 ml są doskonałe do podróży, na siłownię czy basen, zapewniając luksusową pielęgnację skóry w dowolnym miejscu.Wegańska i Naturalna Formuła:Żele zawierają łagodne substancje myjące oraz kompleksy składników nawilżających, zapewniając delikatne, a zarazem skuteczne oczyszczanie i ochronę skóry.Wszechstronne Zastosowanie:Doskonałe do codziennego użytku, te wegańskie żele sprawdzają się w każdej sytuacji, dostarczając skóry odżywcze składniki i zmysłowe zapachy.', '', 'czysciopak-damski-3-x-zel-500ml-rock-class-bossy', '', '', '', 'Czyściopak Damski - 3 x Żel 500ml - Rock, Class, Bossy', '', '', '', ''),
(1334, 1, 1, 'Wszechstronność Wykorzystania:Od Jalapeno czerwonego i zielonego, idealnych do sals, nachos i marynat, po intensywne chili Ancho – zestaw oferuje składniki do wielu dań, od zup po dania z grilla.Intensywna Pikantność:Papryka Bird\'s Eye oraz chili grys i krążki dodają potrawom niezwykłej ostrości, idealnej do dań takich jak curry, stir-fry czy pikantne sosy.Estetyczne Opakowanie:Schowany w poręcznym kartoniku z urzekającą grafiką zestaw stanowi doskonały prezent dla miłośników kulinariów, gotowy do wręczenia na każdą okazję.Inspiracja do Eksperymentów:Zestaw zachęca do eksploracji i eksperymentowania ze smakami, umożliwiając tworzenie wyjątkowych dań i odkrywanie nowych wymiarów kulinarnych doznań przez cały rok.', '', 'zestaw-dibys-przyprawy-chili', '', '', '', 'Zestaw DIBYS - Przyprawy Chili', '', '', '', ''),
