(2133, 1, 1, 'Bogactwo Zapachów:Zestaw oferuje trzy wyjątkowe kompozycje zapachowe: uwodzicielską piwonię, zmysłową magnolię z różowym pieprzem oraz energetyzujące kiwi i winogrona, idealne na różne okazje i nastroje.Idealny na Prezent:Elegancko zapakowany w kartonik sześciopak, zestaw jest gotowy do wręczenia jako upominek na urodziny, Dzień Kobiet czy inne specjalne okazje, gwarantując radość i satysfakcję obdarowanej.Praktyczna Pojemność:Miniaturowe buteleczki o pojemności 100 ml są doskonałe do podróży, na siłownię czy basen, zapewniając luksusową pielęgnację skóry w dowolnym miejscu.Wegańska i Naturalna Formuła:Żele zawierają łagodne substancje myjące oraz kompleksy składników nawilżających, zapewniając delikatne, a zarazem skuteczne oczyszczanie i ochronę skóry.Wszechstronne Zastosowanie:Doskonałe do codziennego użytku, te wegańskie żele sprawdzają się w każdej sytuacji, dostarczając skóry odżywcze składniki i zmysłowe zapachy.', '', 'czysciopak-damski-3-x-zel-500ml-rock-class-bossy', '', '', '', 'Czyściopak Damski - 3 x Żel 500ml - Rock, Class, Bossy', '', '', '', ''),
(2134, 1, 1, 'Naturalna Formuła:Peeling cukrowy jest wegański i zawiera składniki pochodzenia roślinnego, takie jak masło shea i gliceryna, zapewniając delikatne, ale skuteczne oczyszczanie skóry.Uwodzicielski Zapach:Aromaty magnolii i różowego pieprzu tworzą zmysłową kompozycję zapachową, wzbogaconą o nuty pomarańczy, róży i wanilii, które pozostawiają skórę subtelnie pachnącą.Efekt Ujędrniający i Antycellulitowy:Dzięki zawartości ekstraktów z zielonej kawy, papryki i cynamonu, peeling wspomaga ujędrnianie skóry oraz redukcję cellulitu.Wygładzające Działanie:Złuszcza martwy naskórek, pozostawiając skórę gładką i miękką, doskonale przygotowaną do dalszych zabiegów pielęgnacyjnych.Łatwa Aplikacja:Lekką konsystencję musu łatwo rozprowadza się na skórze, a po spienieniu i spłukaniu pozostawia odświeżający efekt, działając jak alternatywa dla żelu pod prysznic.', '', 'magnolia-peeling-cukrowy-220g-zapach-melon', '', '', '', 'Magnolia - Peeling cukrowy 220g, zapach Melon', '', '', '', ''),
(2135, 1, 1, 'Niezapomniane Doświadczenie:Każde fondue zamienia się w wyjątkowy moment dzięki zabawnemu, otwierającemu oczy kotkowi, co sprawia, że spotkania są bardziej interaktywne i angażujące.Wszechstronność:Nadaje się zarówno do serowego, jak i czekoladowego fondue, co czyni go uniwersalnym dodatkiem do każdej kuchni.Estetyka i Funkcjonalność:Oryginalny design łączy piękno z praktycznością, przyciągając wzrok i dodając osobistego akcentu do każdego posiłku.Świetny na Prezent:Dzięki wyjątkowemu wyglądowi i funkcji termoczułej, zestaw jest wspaniałym prezentem, który zaskoczy i ucieszy każdego miłośnika kotów i kulinarnych przygód.Praktyczne Akcesoria:W zestawie znajduje się świeczka i cztery widelce z różnymi kolorami, co ułatwia różnicowanie i używanie zestawu podczas wspólnych posiłków.', '', 'magiczne-fondue-czarny-kot', '', '', '', 'Magiczne Fondue - Czarny Kot', '', '', '', ''),
(2136, 1, 1, 'Wszechstronność Wykorzystania:Od Jalapeno czerwonego i zielonego, idealnych do sals, nachos i marynat, po intensywne chili Ancho – zestaw oferuje składniki do wielu dań, od zup po dania z grilla.Intensywna Pikantność:Papryka Bird\'s Eye oraz chili grys i krążki dodają potrawom niezwykłej ostrości, idealnej do dań takich jak curry, stir-fry czy pikantne sosy.Estetyczne Opakowanie:Schowany w poręcznym kartoniku z urzekającą grafiką zestaw stanowi doskonały prezent dla miłośników kulinariów, gotowy do wręczenia na każdą okazję.Inspiracja do Eksperymentów:Zestaw zachęca do eksploracji i eksperymentowania ze smakami, umożliwiając tworzenie wyjątkowych dań i odkrywanie nowych wymiarów kulinarnych doznań przez cały rok.', '', 'zestaw-dibys-przyprawy-chili', '', '', '', 'Zestaw DIBYS - Przyprawy Chili', '', '', '', ''),
(2137, 1, 1, 'Zestaw DIY do przygotowania wódkiNadaj swoim koktajlom wyjątkowy, personalizowany smak100% naturalne przyprawyZaskocz swoich znajomych i rodzinę oryginalnymi drinkamiWyprodukowano w EuropieWykorzystaj w trakcie spotkań z przyjaciółmiElegancki zestaw idealnie nadający się na prezent', '', 'zestaw-diy-do-przygotowania-wodki', '', '', '', 'Zestaw DIY do przygotowania wódki', '', '', '', ''),
(2138, 1, 1, 'Kocyko-bluza idealna na chłodne dni i wieczoryJeden uniwersalny rozmiar oversizeWytrzymałe podwójne szwyŚwietne rozwiązanie dla amatorów ciepłaZawiera praktyczną kieszonkę na ręce, zapewniając dodatkowy komfortZarówno dla kobiet, jak i dla mężczyznModny, stylowy designŚwietny pomysł na prezent dla lubiących ciepło', '', 'kocyko-bluza-deluxe-czerwona', '', '', '', 'Kocyko-bluza Deluxe - Czerwona', '', '', '', ''),
(2139, 1, 1, 'Idealny prezent:Doskonały dla miłośników kuchni, kotów lub osób, które cenią sobie zabawne i oryginalne stroje. Kto powiedział, że fartuch musi być nudny?Wbudowana kieszeń:Duża kieszeń z mikrofibry jest idealna do suszenia rąk. Możesz w niej również przechowywać telefon, przyrządy kuchenne czy inne niezbędne przedmioty.Regulacja:Zaprojektowany z myślą o dorosłych, wykonany z poliestru i bawełny, fartuch dopasowuje się do każdej wysokości i rozmiaru dzięki regulowanym paskom.Praktyczność:Gotowanie to zabawa! Nie martw się o zabrudzenia – fartuch łatwo wypierzesz w pralce, używając standardowego cyklu prania.Wymiary:80x53x0,2 cm, wykonany z poliestruWymiar wersji dla dzieci kolor szary: 50x43x0,2 cm', '', 'fartuszek-kociary', '', '', '', 'Fartuszek Kociary', '', '', '', ''),
(2140, 1, 1, 'Urokliwy design:Kubek w kształcie lisa z żywymi pomarańczowymi i białymi akcentami to prawdziwa ozdoba każdej kuchni.Ręcznie malowany:Każdy kubek jest unikalny, ze starannie odmalowanymi detalami i przyjaznym wyrazem lisiej mordki.Wszechstronny:Świetny do serwowania ciepłych napojów, zarówno kawy, herbaty, jak i innych ulubionych płynów.Pojemność:Kubek ma 350 ml pojemności, idealny na każdą porcję ciepła i radości.Łatwość utrzymania:Zaleca się mycie ręczne, aby zachować jego piękno na długo, dostarczany w kolorowym opakowaniu upominkowym.', '', 'uroczy-kubek-lisek', '', '', '', 'Uroczy kubek Lisek', '', '', '', ''),
(2141, 1, 1, 'Uroczy design leniwca:Kubek z wyrazistą twarzą leniwca, z wielkimi oczami i delikatnym wyrazem, który rozjaśni każdy dzień.Ręcznie malowany:Dzięki ręcznemu malowaniu każdy egzemplarz jest wyjątkowy i przyjazny dla oka, dodając indywidualnego charakteru.Idealny na prezent:Świetny upominek dla miłośników relaksu i leniwych poranków, zapakowany w kolorowe opakowanie upominkowe.Dbałość o szczegóły:Zaleca się mycie ręczne, aby zachować piękno i trwałość na lata.Wygodna pojemność:Kubek o pojemności 300 ml, idealny na ulubione napoje.', '', 'uroczy-kubek-leniwiec', '', '', '', 'Uroczy kubek Leniwiec', '', '', '', ''),
(2142, 1, 1, 'Designerska poduszka:Piękna ceramiczna poduszka służy jako wyjątkowa podstawka, wprowadzając element luksusu i stylu do codziennych chwil.Królewski prezent:Idealny upominek dla tych, którzy cenią niebanalne i eleganckie dodatki.Optymalna pojemność:Filiżanka o pojemności 250 ml, w sam raz na ulubiony napój.Różnorodność kolorów:Dostępna także w kolorach różowym i turkusowym, co pozwala dopasować zestaw do osobistych preferencji.Dbałość o szczegóły:Zaleca się mycie ręczne, nie nadaje się do mikrofalówki, dostarczana w kolorowym opakowaniu upominkowym.', '', 'filizanka-wykwintna-biala', '', '', '', 'Filiżanka wykwintna - Biała', '', '', '', ''),
(2143, 1, 1, 'Nowoczesny design:Idealnie komponuje się z różnorodnymi stylami wnętrzarskimi, łącząc estetykę z praktycznością.Trwałe i łatwe do czyszczenia:Wykonany z wysokiej jakości materiału imitującego szkło, który jest odporny i prosty w pielęgnacji.Uniwersalna ekspozycja:Doskonały do prezentacji świeżych i sztucznych kwiatów, nadaje przestrzeni nowoczesny wygląd.Wszechstronny:Może być ustawiony na stole, półce czy parapecie, dodając elegancji każdemu pomieszczeniu.', '', 'wazonik-ramka-do-kwiatow', '', '', '', 'Wazonik - ramka do kwiatów', '', '', '', ''),
(2144, 1, 1, 'Termometr Galileusza w kształcie kropliWysokość ok. 27 cmŚrednica 20 cmEfektowny termometr edukacyjnyTermometr mierzy temperaturę w stopniach CelsjuszaTemperaturę pokazuje najniżej położona kula z najwyżej wzniesionych', '', 'termometr-galileusza-kropla-xxl', '', '', '', 'Termometr Galileusza - Kropla XXL', '', '', '', ''),
(2145, 1, 1, 'Redukcja stresu:Skutecznie zmniejsza napięcie i stres podczas ściskania.Unikalny design:Realistyczna forma mózgu, która zwraca uwagę i jest ciekawym dodatkiem na biurko.Wysokiej jakości materiał:Wykonany z miękkiej, elastycznej pianki, odpornej na wielokrotne użycie.Średnica ok 13cm.Poprawa koncentracji:Pomaga w skupieniu się podczas pracy lub nauki, zajmując ręce.Kompaktowy rozmiar:Poręczny rozmiar, łatwy do przenoszenia w torbie czy plecaku.Zabawny i edukacyjny:Idealny gadżet dla entuzjastów nauki i anatomii.Bezpieczny dla dzieci i dorosłych:Nietoksyczny, przyjazny dla skóry materiał, odpowiedni dla wszystkich grup wiekowych.Idealna na prezent:Świetny pomysł na prezent dla kolegów z pracy, studentów, nauczycieli oraz miłośników gadżetów.', '', 'antystresowy-mozg', '', '', '', 'Antystresowy Mózg', '', '', '', ''),
