(2300, 1, 1, 'Gigantyczna maskotka tarantuli łączy w sobie elementy przerażające i miękkość, idealna do przytulania oraz na Halloween.Dzięki realistycznemu designowi stanowi doskonałą dekorację i świetny prezent dla miłośników pająków.Miękkie, wysokiej jakości materiały sprawiają, że maskotka jest przyjemna w dotyku, doskonała zarówno do straszenia, jak i przytulania.Wymiary produktu: 50 cm x 85 cm x 30 cm, waga netto: 800 gramów; idealna do dekoracji każdego pomieszczenia.Materiał: Poliester', '', 'pluszak-tarantula-gigant-80-cm', '', '', '', 'Pluszak Tarantula Gigant - 80 cm', '', '', '', ''),
(2301, 1, 1, 'Podwójna funkcjonalność:Ten produkt łączy w sobie funkcję zakładki do książek i lampki do czytania. Głowa kota wystaje, pełniąc rolę przewodnika do aktualnej strony, a elastyczne ciało można zgiąć i włączyć, by oświetlić tekst.Idealny prezent:Świetny pomysł na podarunek dla fanów kotów i miłośników książek, doskonały do czytania w samolocie, podczas bezsennych nocy czy dla osób preferujących subtelne oświetlenie.Miękki i elastyczny:Wykonana z miękkiego silikonu z metalowym rdzeniem, lampa jest łatwa do zginania, zapewnia stabilność podczas użytkowania i nie uszkadza stron książki.Baterie w zestawie:Lampa wyposażona jest w dwie baterie CR1220, które są dołączone, a włącznik znajduje się z tyłu głowy kota.Wymiary:16x8x1,3 cm, wykonana z silikonu, zaprojektowana przez Oscara Torrenta.', '', 'lampka-do-czytania-kot', '', '', '', 'Lampka Do Czytania - Kot', '', '', '', ''),
(2302, 1, 1, 'Wyzwanie i zabawa:Magiczna Łamigłówka Ubik 3D zapewnia godziny umysłowej rozrywki, co czyni ją idealnym wyborem dla miłośników łamigłówek w każdym wieku.Innowacyjny design:Dzięki unikalnej konstrukcji 3D, kostka ta dodaje współczesny twist do klasycznej łamigłówki, zwiększając zarówno walory wizualne, jak i stopień trudności.Trwała konstrukcja:Wykonana z wysokiej jakości materiałów, Magiczna Kostka jest zbudowana tak, aby wytrzymać częste używanie, zapewniając długotrwałą trwałość i płynne, przyjemne doświadczenie.Przenośna i kompaktowa:Jej kompaktowy rozmiar sprawia, że łatwo ją zabrać w podróż, oferując przenośne źródło rozrywki, gdziekolwiek jesteś.Poprawia umiejętności poznawcze:Rozwiązywanie Magicznej Kostki pomaga wzmocnić zdolności do rozwiązywania problemów, świadomość przestrzenną i pamięć, co czyni ją korzystną aktywnością dla rozwoju poznawczego.', '', 'magiczna-lamiglowka-ubik', '', '', '', 'Magiczna Łamigłówka Ubik', '', '', '', ''),
(2303, 1, 1, 'Zabawna i Wciągająca:Zajmuje dzieci na godziny dzięki dynamicznej i konkurencyjnej rozgrywce.Poprawia Koordynację:Pomaga w rozwijaniu koordynacji ręka-oko i zdolności motorycznych poprzez strategiczne przesuwanie krążków.Wysokiej Jakości Materiały:Wykonana z trwałego drewna i gładkich krążków, zapewniając wysokiej jakości doświadczenie gry.Przenośny Design:Kompaktowa i lekka, co ułatwia przenoszenie i grę w dowolnym miejscu - w domu, na zewnątrz, czy w podróży.Proste Zasady:Łatwe do zrozumienia mechanizmy gry, odpowiednie dla dzieci w każdym wieku.Gra Dwuosobowa:Zachęca do interakcji społecznych i przyjaznej rywalizacji między rodzeństwem, przyjaciółmi lub rodzicami.Idealny Prezent:Doskonały pomysł na prezent na urodziny, święta lub każdą specjalną okazję dla młodych entuzjastów gier.Wartość Edukacyjna:Promuje strategiczne myślenie, cierpliwość i skupienie, oferując jednocześnie zabawną aktywność.Bez Baterii:Ekologiczna i ekonomiczna, bez potrzeby zasilania czy baterii.Bezpieczna i Przyjazna Dzieciom:Zaprojektowana z gładkimi krawędziami i bezpiecznymi materiałami, zapewniając bezpieczne doświadczenie gry dla dzieci.', '', 'gra-zrecznosciowa-sling-puck', '', '', '', 'Gra zręcznościowa Sling Puck', '', '', '', ''),
