(2653, 1, 1, 'Wszechstronność Wykorzystania:Od Jalapeno czerwonego i zielonego, idealnych do sals, nachos i marynat, po intensywne chili Ancho – zestaw oferuje składniki do wielu dań, od zup po dania z grilla.Intensywna Pikantność:Papryka Bird\'s Eye oraz chili grys i krążki dodają potrawom niezwykłej ostrości, idealnej do dań takich jak curry, stir-fry czy pikantne sosy.Estetyczne Opakowanie:Schowany w poręcznym kartoniku z urzekającą grafiką zestaw stanowi doskonały prezent dla miłośników kulinariów, gotowy do wręczenia na każdą okazję.Inspiracja do Eksperymentów:Zestaw zachęca do eksploracji i eksperymentowania ze smakami, umożliwiając tworzenie wyjątkowych dań i odkrywanie nowych wymiarów kulinarnych doznań przez cały rok.', '', 'zestaw-dibys-przyprawy-chili', '', '', '', 'Zestaw DIBYS - Przyprawy Chili', '', '', '', ''),
(2654, 1, 1, 'Idealny dla Majsterkowiczów:Zestaw zawiera dwie pary czerwonych skarpetek z nadrukami podstawowych narzędzi, takich jak młotek, piła, śrubokręt i klucz francuski, co czyni go idealnym dla każdego entuzjasty prac domowych.Uniwersalny Gadżet:Oryginalne skarpetki zapakowane w kartonowej skrzynce, która może służyć do przechowywania drobnych narzędzi, sprawiają, że jest to świetny prezent dla każdego majsterkowicza, niezależnie od wieku.Prezent Na Wiele Okazji:Niezależnie od tego, czy jest to prezent dla taty, dziadka, przyjaciela, czy kogoś odkrywającego nowe pasje, zestaw skarpetek z narzędziami będzie zabawnym i praktycznym dodatkiem.Naturalne Materiały:Wykonane ze 100% bawełny z certyfikatem OEKO-TEX, skarpetki są trwałe, miękkie i przewiewne, zapewniając komfort podczas każdego rodzaju aktywności.Stylowy Dodatek do Każdego Stroju:Skarpetki DIY BOX OF SOCKS to nie tylko wygoda w warsztacie, ale także oryginalny dodatek, który doda charakteru zarówno codziennym, jak i biznesowym stylizacjom.', '', 'skarpetki-diy-majsterkowicza-41-46', '', '', '', 'Skarpetki DIY Majsterkowicza 41-46', '', '', '', ''),
