(2656, 1, 1, 'Podwójna funkcjonalność:Ten produkt łączy w sobie funkcję zakładki do książek i lampki do czytania. Głowa kota wystaje, pełniąc rolę przewodnika do aktualnej strony, a elastyczne ciało można zgiąć i włączyć, by oświetlić tekst.Idealny prezent:Świetny pomysł na podarunek dla fanów kotów i miłośników książek, doskonały do czytania w samolocie, podczas bezsennych nocy czy dla osób preferujących subtelne oświetlenie.Miękki i elastyczny:Wykonana z miękkiego silikonu z metalowym rdzeniem, lampa jest łatwa do zginania, zapewnia stabilność podczas użytkowania i nie uszkadza stron książki.Baterie w zestawie:Lampa wyposażona jest w dwie baterie CR1220, które są dołączone, a włącznik znajduje się z tyłu głowy kota.Wymiary:16x8x1,3 cm, wykonana z silikonu, zaprojektowana przez Oscara Torrenta.', '', 'lampka-do-czytania-kot', '', '', '', 'Lampka Do Czytania - Kot', '', '', '', ''),
(2657, 1, 1, 'Innowacyjny design:Butelka w kształcie granatu, wykończona w kolorze militarnym, dla miłośników niebanalnych dodatków.Wytrzymała i elastyczna:Wykonana z wysokiej jakości silikonu platynowego, odporna na uszkodzenia i wygodna w przechowywaniu.Funkcjonalna konstrukcja:Metalowy pierścień w szyjce zapewnia szczelność i trwałość, pozwalając na przechowywanie napojów w różnych temperaturach.Praktyczne rozwiązania:Składany ustnik i możliwość przypięcia za pomocą karabińczyka sprawiają, że butelka jest idealna na każdą okazję.Pojemność 580 ml:Doskonała pojemność do nawodnienia podczas codziennych aktywności i przygód.', '', 'skladany-bidon-granat', '', '', '', 'Składany Bidon - Granat', '', '', '', ''),
