(2722, 1, 1, 'Elegancka pluszowa okładka: Miękka w dotyku, zapewnia luksusowy wygląd.Praktyczny format A5 (21x14 cm): Idealny do notowania na co dzień.Zamykany na kłódkę: Twoje zapiski zawsze bezpieczne.120 stron: Dużo miejsca na pomysły, plany i marzenia.Oficjalna licencja Harry Potter: Doskonały prezent dla fanów serii.', '', 'notatnik-z-klodka-harry-potter-a5', '', '', '', 'Notatnik z Kłódką Harry Potter A5', '', '', '', ''),
