(2727, 1, 1, 'Śniadaniówka dla dzieci Lilo&amp;Stitch– Pudełko śniadaniowe z wyjmowaną wkładką jest idealne w podróży. Dzięki kompaktowym wymiarom ok. 18 x 13,5 x 6 cm zmieści się w każdej torbie i plecaku. Pojemność: ok. 800 ml. Waga produktu: ok. 131 g.Butelka na wodę dla dzieci– Dzięki zakręcanemu korkowi, butelka może być szybko napełniona. Wysuwany dzióbek z wbudowaną słomką ułatwia picie. Pojemność: ok. 500 ml, wysokość: 19 cm, średnica: 9 cm.Łatwe do czyszczenia– Pudełko śniadaniowe i butelka do picia mogą być łatwo płukane i czyszczone pod bieżącą wodą.Najwyższa jakość ScooliZestaw prezentowy– Zestaw zawiera pudełko śniadaniowe z wyjmowaną wkładką oraz butelkę do picia Aero. Dzięki poręcznym rozmiarom, butelka i pudełko śniadaniowe mieszczą się w każdej torbie. Idealne do przedszkola i szkoły!', '', 'zestaw-lunch-box-i-bidon-lilo-stitch', '', '', '', 'Zestaw Lunch Box i Bidon - Lilo & Stitch', '', '', '', ''),
(2728, 1, 1, 'Duża pojemność:Z pojemnością 160 ml wody, możesz cieszyć się dłuższą rozgrywką bez ciągłego uzupełniania.Doskonały prezent:Świetny wybór zarówno dla dzieci, jak i dorosłych ceniących zabawę i innowacyjne rozwiązania.Łatwa transformacja:Przełączanie między formami jest prostym naciśnięciem przycisku, co pozwala na szybkie i efektywne działanie.Pięć form: Kusza, Tarcza, Miecz, Chwytak, BumerangAktywność STEAM:Połączenie zabawy z nauką dzięki możliwości eksplorowania różnych mechanizmów i eksperymentów inżynieryjnych.Wymiary:około 29 cm x 16,5 cm x 55,5 cm', '', 'skladany-mega-cyborg', '', '', '', 'Składany Mega Cyborg', '', '', '', ''),
(2729, 1, 1, 'Składane Hydrauliczne Ramię CyborgaZestaw do samodzielnego złożeniaZestaw składa się aż z 229 częściZałączona instrukcja ułatwiająca składanieZłożenie zajmuje zazwyczaj do paru godzinZabawka hydrauliczna – nie wymaga zasilania zewnętrznegoWspaniała zabawka edukacyjna dla dzieciŚwietny pomysł na prezent na święta czy urodzinyProdukt przeznaczony dla dzieci powyżej 10. roku życia', '', 'hydrauliczne-ramie', '', '', '', 'Hydrauliczne Ramię', '', '', '', ''),
(2730, 1, 1, 'Podwójna funkcjonalność:Ten produkt łączy w sobie funkcję zakładki do książek i lampki do czytania. Głowa kota wystaje, pełniąc rolę przewodnika do aktualnej strony, a elastyczne ciało można zgiąć i włączyć, by oświetlić tekst.Idealny prezent:Świetny pomysł na podarunek dla fanów kotów i miłośników książek, doskonały do czytania w samolocie, podczas bezsennych nocy czy dla osób preferujących subtelne oświetlenie.Miękki i elastyczny:Wykonana z miękkiego silikonu z metalowym rdzeniem, lampa jest łatwa do zginania, zapewnia stabilność podczas użytkowania i nie uszkadza stron książki.Baterie w zestawie:Lampa wyposażona jest w dwie baterie CR1220, które są dołączone, a włącznik znajduje się z tyłu głowy kota.Wymiary:16x8x1,3 cm, wykonana z silikonu, zaprojektowana przez Oscara Torrenta.', '', 'lampka-do-czytania-kot', '', '', '', 'Lampka Do Czytania - Kot', '', '', '', ''),
(2731, 1, 1, 'Bezpieczeństwo i jakość:Wykonany z materiałów najwyższej jakości, włączając 100% poliester i wypełnienie z włókna silikonowego. Posiada certyfikat CE, co czyni go bezpiecznym dla dzieci powyżej 3 lat.Ręcznie robiony:Produkt stworzony w Polsce, z troską o najwyższe standardy wykonania i detali.Idealny do zabawy:Długość kija (30 cm) została dobrana tak, aby był wygodny i pozwalał na swobodne skakanie przez przeszkody.Kompletny zestaw:Konik wyposażony w czarny kantar i wodze, co umożliwia natychmiastowe rozpoczęcie zabawy.Różnorodność rozmiarów:Dostępne modele jak A5, A4, A3 idealnie nadają się do różnych stylów zabawy i użytkowników o różnym wzroście oraz preferencjach.', '', 'konik-na-kiju-a5-hobby-horse', '', '', '', 'Konik na kiju A5 - Hobby Horse', '', '', '', ''),
(2732, 1, 1, 'Innowacyjny design:Butelka w kształcie granatu, wykończona w kolorze militarnym, dla miłośników niebanalnych dodatków.Wytrzymała i elastyczna:Wykonana z wysokiej jakości silikonu platynowego, odporna na uszkodzenia i wygodna w przechowywaniu.Funkcjonalna konstrukcja:Metalowy pierścień w szyjce zapewnia szczelność i trwałość, pozwalając na przechowywanie napojów w różnych temperaturach.Praktyczne rozwiązania:Składany ustnik i możliwość przypięcia za pomocą karabińczyka sprawiają, że butelka jest idealna na każdą okazję.Pojemność 580 ml:Doskonała pojemność do nawodnienia podczas codziennych aktywności i przygód.', '', 'skladany-bidon-granat', '', '', '', 'Składany Bidon - Granat', '', '', '', ''),
(2733, 1, 1, 'Składana konstrukcja:Butelka jest elastyczna i po opróżnieniu składa się do kompaktowych rozmiarów, co ułatwia przechowywanie.Praktyczny karabińczyk:Umożliwia łatwe przyczepienie do paska, plecaka lub torby, zapewniając wygodny dostęp podczas aktywności.Duża pojemność:Mieści do 550 ml, co pozwala na skuteczne nawodnienie w szkole, podczas treningu czy na wycieczkach.Bezpieczny materiał:Wykonana z silikonu do kontaktu z żywnością, wolna od BPA i ftalanów, nie pochłania zapachów.Łatwość czyszczenia:Szeroki otwór umożliwia łatwe mycie i napełnianie, a składany ustnik zapewnia wygodę picia.', '', 'skladany-bidon-koszykowka', '', '', '', 'Składany Bidon - Koszykówka', '', '', '', ''),
(2734, 1, 1, 'Wyzwanie i zabawa:Magiczna Łamigłówka Ubik 3D zapewnia godziny umysłowej rozrywki, co czyni ją idealnym wyborem dla miłośników łamigłówek w każdym wieku.Innowacyjny design:Dzięki unikalnej konstrukcji 3D, kostka ta dodaje współczesny twist do klasycznej łamigłówki, zwiększając zarówno walory wizualne, jak i stopień trudności.Trwała konstrukcja:Wykonana z wysokiej jakości materiałów, Magiczna Kostka jest zbudowana tak, aby wytrzymać częste używanie, zapewniając długotrwałą trwałość i płynne, przyjemne doświadczenie.Przenośna i kompaktowa:Jej kompaktowy rozmiar sprawia, że łatwo ją zabrać w podróż, oferując przenośne źródło rozrywki, gdziekolwiek jesteś.Poprawia umiejętności poznawcze:Rozwiązywanie Magicznej Kostki pomaga wzmocnić zdolności do rozwiązywania problemów, świadomość przestrzenną i pamięć, co czyni ją korzystną aktywnością dla rozwoju poznawczego.', '', 'magiczna-lamiglowka-ubik', '', '', '', 'Magiczna Łamigłówka Ubik', '', '', '', ''),
(2735, 1, 1, 'Zabawna i Wciągająca:Zajmuje dzieci na godziny dzięki dynamicznej i konkurencyjnej rozgrywce.Poprawia Koordynację:Pomaga w rozwijaniu koordynacji ręka-oko i zdolności motorycznych poprzez strategiczne przesuwanie krążków.Wysokiej Jakości Materiały:Wykonana z trwałego drewna i gładkich krążków, zapewniając wysokiej jakości doświadczenie gry.Przenośny Design:Kompaktowa i lekka, co ułatwia przenoszenie i grę w dowolnym miejscu - w domu, na zewnątrz, czy w podróży.Proste Zasady:Łatwe do zrozumienia mechanizmy gry, odpowiednie dla dzieci w każdym wieku.Gra Dwuosobowa:Zachęca do interakcji społecznych i przyjaznej rywalizacji między rodzeństwem, przyjaciółmi lub rodzicami.Idealny Prezent:Doskonały pomysł na prezent na urodziny, święta lub każdą specjalną okazję dla młodych entuzjastów gier.Wartość Edukacyjna:Promuje strategiczne myślenie, cierpliwość i skupienie, oferując jednocześnie zabawną aktywność.Bez Baterii:Ekologiczna i ekonomiczna, bez potrzeby zasilania czy baterii.Bezpieczna i Przyjazna Dzieciom:Zaprojektowana z gładkimi krawędziami i bezpiecznymi materiałami, zapewniając bezpieczne doświadczenie gry dla dzieci.', '', 'gra-zrecznosciowa-sling-puck', '', '', '', 'Gra zręcznościowa Sling Puck', '', '', '', ''),
(2736, 1, 1, 'Redukcja stresu:Skutecznie zmniejsza napięcie i stres podczas ściskania.Unikalny design:Realistyczna forma mózgu, która zwraca uwagę i jest ciekawym dodatkiem na biurko.Wysokiej jakości materiał:Wykonany z miękkiej, elastycznej pianki, odpornej na wielokrotne użycie.Średnica ok 13cm.Poprawa koncentracji:Pomaga w skupieniu się podczas pracy lub nauki, zajmując ręce.Kompaktowy rozmiar:Poręczny rozmiar, łatwy do przenoszenia w torbie czy plecaku.Zabawny i edukacyjny:Idealny gadżet dla entuzjastów nauki i anatomii.Bezpieczny dla dzieci i dorosłych:Nietoksyczny, przyjazny dla skóry materiał, odpowiedni dla wszystkich grup wiekowych.Idealna na prezent:Świetny pomysł na prezent dla kolegów z pracy, studentów, nauczycieli oraz miłośników gadżetów.', '', 'antystresowy-mozg', '', '', '', 'Antystresowy Mózg', '', '', '', ''),
