(2854, 1, 1, 'Stylowa dekoracja:Kołyska Newtona to elegancki dodatek na biurko z klasycznym designem, który dodaje uroku każdemu wnętrzu.Relaksujący mechanizm:Uspokajający ruch kul pomaga złagodzić stres i zapewnić chwilę odprężenia w trakcie dnia pracy.Wysoka jakość wykonania:Drewniana podstawa i metalowa, srebrzysta konstrukcja gwarantują trwałość i luksusowy wygląd.Idealny prezent:Doskonały upominek dla szefa lub kolegi, symbolizujący dobry gust i elegancję.Inspiracja fizyką:Kołyska Newtona to nie tylko dekoracja, ale także sposób na wprowadzenie naukowego ducha do biura.Wymiary:18 x 18 x 12 cm', '', 'kolyska-newtona', '', '', '', 'Kołyska Newtona', '', '', '', ''),
